class secoundInput extends Component {
  constructor(props) {
    super(props);
  }


  setunit (){
    var keys = Object.keys(unit);
    for(var i = 0;i< keys.length; i++){
      var unitkey = Object.keys(unit[keys[0]]);
      for(var j=0; j< unitkey.length; j++){
          var unit1 = unit[keys[i]][unitkey[0]]
          var unit2 = unit[keys[i]][unitkey[1]]
          var unit3 = unit[keys[i]][unitkey[2]]
          var unit4 = unit[keys[i]][unitkey[3]]
      }
    }
  }


  //  Type = this.props.unit

  // keys = Object.keys(unit.unitvalue()[0])
  // unit = Object.keys(unit.unitvalue()[1][keys[1]])
  // for (var i=0; i< keys.length; i++){
  //   if(this.props.unit == 1){

  //   }
  // }

  render() {
    return (
      <div>
        <label htmlFor="fname">Enter Value :</label>
        <input
          type="text"
          id="output"
          // onChange={this.changeFirstInput}
          // value={this.state.firstInput}
        />

        <select id="secoundUnit">
          <option value="N/A">Select Unit</option>

          <option value="FEET">{setunit().unit1}</option>
          <option value="INCH">{setunit.unit2}</option>
          <option value="YARD">{setunit.unit3}</option>
          <option value="CM">{setunit.unit4}</option>
        </select>
      </div>
    );
  }
}

export default secoundInput;
